import React from 'react';
import { Typography, Box } from '@mui/material';
import SetMealIcon from '@mui/icons-material/SetMeal'; // Replace with a relevant icon

function InfoCard({ title, description }) {
  return (
    <Box sx={{ textAlign: 'center', padding: 2 }}>
      <SetMealIcon fontSize="large" sx={{ color: '#d6b98d' }} />
      <Typography variant="h6" sx={{ color: '#132a47', fontWeight: 'bold', marginTop: 2 }}>
        {title}
      </Typography>
      <Typography variant="body2" sx={{ color: '#4a4a4a' }}>
        {description}
      </Typography>
    </Box>
  );
}

export default InfoCard;
